import { useState } from "react";
import styled from "styled-components";
import { ReactComponent as EccLogo } from "../Resource/svg/EccLogo.svg";
import GlobalFont from "../Resource/font/fonts";
import {
  SignInContainer,
  SignInInputAreaContainer,
  SignInInputArea,
  AutoLogin,
  AutoLoginCotainer,
  CheckMark
} from "./AuthenticationStyleComponent";
const EccText = styled.h3`
  font-family: "roboto";
  color: #3763ff;
  opacity: 0.4;
`;

const SignIn = () => {
  return (
    <SignInContainer>
      <EccLogo style={{ margin: "auto" }} />
      <GlobalFont />
      <EccText>EXPANDED CORE CURRICULUM</EccText>
      <SignInInputAreaContainer>
        <SignInInputArea />
        <SignInInputArea />
      </SignInInputAreaContainer>
      <AutoLoginCotainer>
        <AutoLogin />
        <CheckMark>
        <div className="checkmark_stem"></div>
        <div className="checkmark_kick"></div>
        </CheckMark>
        <span style={{'position':'absolute','left':'5rem','paddingTop':'0.4rem'}}>자동 로그인</span>
      </AutoLoginCotainer>
    </SignInContainer>
  );
};

export default SignIn;
